int selectionsort(int arr[], int size)
{
	clock_t start = clock(); 
	for(int i = 1;i < size - 1;i++)
	{	
		int maxim = arr[size - i];
		int mind = size -i;	
			
		for(int j = 0; j <= size -i;j++)
		{
			
			if(maxim<arr[j])
			{
				maxim = arr[j];
				mind = j;
			}
			
		}
		
		int temp = arr[size - i];
		arr[size - i] = maxim;
		arr[mind] = temp;
		
			
	}
clock_t end = clock(); 
	int diff = end - start;
	return diff;
}

